import { Colors } from "../../../../settings/styles/theme";

const styles = {
    container: {
        flex: 1
    },
    cameraContainer: {
        flex: 1, 
        flexDirection: "row", 
        justifyContent: "center",
        margin: 30
    },
    iconContainer: {
        alignSelf: 'flex-end',
        alignItems: 'center',
        backgroundColor: 'transparent',
    },
    textFontFamily: {
        fontFamily: "RobotoRegular"
    }
};

export default styles;
